import React from 'react';
import {H_SData} from './H&SData';
import Card from './Card';
import { useState } from 'react';
 

const Hide_Show=()=>{

    const [getData,update]=useState(H_SData);

    return(

        <>
        
         {
             getData.map((val)=>{
             const {id}= val;
             return <Card 
                     key={id} {...val} />
             
         }) 
         } 
        </>
    )
}

export default Hide_Show;
